// import { BrowserRouter, Route, Routes } from "re
import { Route, Routes } from 'react-router-dom';
import Home from './routes/home/Home';

function App() {
  return (
    <div>
      <Routes>
        <Route path='/' el/>
      </Routes>
      <Home />
    </div>
  );
}

export default App;
